import axios from "axios";
import { useState } from "react";

function Phones(){
    const [phones, setPhones] = useState()
    return(
        axios.get("http://localhost:5005/api/phones")
        .then((response)=>{
           setPhones()
        })
        .catch((error) => {
            console.log("error: ", error);
        })
    )
}
export default Phones;
